1241	9923	Ночь живых мертвецов	Night of the Living Dead	«There IS a fate worse than death»	1990-10-19 03:00:00+03	18+	R	92	7	8734	e0192de6-aa91-4855-9bf0-9ff3b4d40fc8.webp	Брат и сестра приезжают навестить могилу своей матушки на кладбище в окрестностях Питтсбурга. Брат пугает сестру рассказами о зомби, не подозревая о том, что он весьма недалек от реальности. Внезапно на них набрасывается один из покойников; брата убивают, а Барбара убегает, обнаруживая по дороге фермерский дом. Через какое-то время к нему подъезжает Бен, в бензобаке машины которого кончился бензин. Они решают остаться в доме и готовиться к обороне. Позже выясняется, что в подвале дома прячутся еще несколько человек. Все вместе они должны забаррикадироваться и переждать страшную ночь - ведь зомби не станут сидеть на крыльце и ждать, пока люди выйдут сами - они будут пытаться прорваться внутрь - желание отведать человеческого мяса в них безумно сильно.
